import { slide as BurgerMenu } from 'react-burger-menu';
import { useRef } from 'react';
import React, { Component } from 'react';

const BurgerMenuComposant = () => {
    return (
        <div className="nav">
            <BurgerMenu right className="menu-fixed">
                <button to="/" className="menu-item">Accueil</button>
                <button to="/about" className="menu-item">A propos</button>
                <button to="/contact" className="menu-item">Contact</button>
            </BurgerMenu>
        </div>
    );
};

export default BurgerMenuComposant
